/** Msg defines the Msg service. */
export interface Msg {
  /**
   * CreateFolio allows a Registry Officer to create a new folio record for a registered land parcel.
   * Each folio acts as the central ledger entry for property ownership, linking all associated deeds and documents.
   * Emits a `folio_created` event on success.
   */
  CreateFolio(request: MsgCreateFolio): Promise<MsgCreateFolioResponse>;
  /**
   * RegisterDeedInFolio links a newly issued deed to its corresponding folio record.
   * This updates the folioâ€™s deed history and sets the current active deed reference.
   * Typically triggered automatically after `deed_issued` events.
   */
  RegisterDeedInFolio(request: MsgRegisterDeedInFolio): Promise<MsgRegisterDeedInFolioResponse>;
  /**
   * SubmitNotarySignature allows a Notary to digitally sign a folio or related deed entry.
   * This ensures notarization of the transaction and adds legal verification to the folio record.
   */
  SubmitNotarySignature(request: MsgSubmitNotarySignature): Promise<MsgSubmitNotarySignatureResponse>;
  /**
   * RequestFolio allows an external user (e.g., landowner or authorized agent) to request access to a folio extract.
   * The request is stored on-chain and awaits review by the Registry Office for approval or rejection.
   */
  RequestFolio(request: MsgRequestFolio): Promise<MsgRequestFolioResponse>;
  /**
   * ApproveFolioRequest allows a Registry Officer to review and approve a folio extract request submitted by a user.
   * Once approved, the requester is granted permission to view or retrieve the folio data.
   */
  ApproveFolioRequest(request: MsgApproveFolioRequest): Promise<MsgApproveFolioRequestResponse>;
}

